INSERT IGNORE INTO `logs_oficios` (`id`, `numero`, `destinatario`, `assunto`, `corpo`, `assinante`, `data`, `tratamento`, `cargo`, `cargo_assinante`, `data_edicao`, `atualizado_por`) VALUES
	(1, '1/2024', 'Núcleo de Governança Fundiária da Corregedoria Geral de Justiça do MA', 'Ofício OFC-NRF – 209/2014 - Titulo de Domínio nº 27.646 – ITERMA – Associação de Moradores do Povoado Rio Grande – Bequimão/MA', '<p>Ilmo(a). Senhor(a) Mar&iacute;lia Linhares Chaves - NGF,</p><p>Cumprimentando Vossa Senhoria, sirvo-me do presente, em resposta ao Of&iacute;cio em ep&iacute;grafe, para informar que de acordo com a legisla&ccedil;&atilde;o o T&iacute;tulo de Dom&iacute;nio 27.646, expedido pelo Instituto de Coloniza&ccedil;&atilde;o e Terras do Maranh&atilde;o &ndash; ITERMA, ingressou neste Cart&oacute;rio de Of&iacute;cio &Uacute;nico em 06/02/2023 e deu origem a abertura de duas matr&iacute;culas imobili&aacute;rias de n&ordm;s 721 e 722, ambas tendo como titular a Associa&ccedil;&atilde;o de Moradores do Povoado Rio Grande, conforme atesta documentos anexos.</p><p>Sendo s&oacute; para o momento, renovo protestos de estima e considera&ccedil;&atilde;o.</p>', 'Antonio José Martins Garcia', '2024-07-01', 'Ao NGF-CGJ/MA', '', 'Escrevente Substituto', '2024-07-02 00:46:17', 'TONY'),
